// File: staking.sol
pragma solidity ^0.8.0;

contract Staking is Ownable {
    using SafeMath for uint256;
    uint256 public totalStake;
    uint256 public totalRewards;
    uint public oldTimeStamp;

    enum StakingPeriod{ ONE_MONTH, TWO_MONTH, THREE_MONTH, SIX_MONTH, ONE_YEAR }

    struct stake {
        uint256 amount;
        StakingPeriod stakePeriod;
        uint timestamp;
    }

    address[] internal stakeholders;
    uint256 public tokenAmountInOldInvestorList;

    mapping(address => mapping(StakingPeriod => stake)) public stakes;
    mapping(StakingPeriod => uint) public apr;
    mapping(StakingPeriod => uint) public apr_old;

    IERC20 public myToken;

    event TokenStaked(address indexed _from, uint amount, StakingPeriod plan, uint timestamp);
    event TokenUnstaked(address indexed _from, uint amount, StakingPeriod plan, uint timestamp);
    event RewardsTransferred(address indexed _to, uint amount, StakingPeriod plan, uint timestamp);

    constructor(address _myToken)
    { 
        myToken = IERC20(_myToken);
        apr[StakingPeriod.ONE_MONTH] = 321; //15 days 
        apr[StakingPeriod.TWO_MONTH] = 775; // 30 days
        apr[StakingPeriod.THREE_MONTH] = 2217; // 90 days 
        apr[StakingPeriod.SIX_MONTH] = 4115; // 120 days
        apr[StakingPeriod.ONE_YEAR] = 6512; // 365 days

        apr_old[StakingPeriod.ONE_MONTH] = 414; //15 days 
        apr_old[StakingPeriod.TWO_MONTH] = 912; // 30 days
        apr_old[StakingPeriod.THREE_MONTH] = 4817; // 90 days 
        apr_old[StakingPeriod.SIX_MONTH] = 7213; // 120 days
        apr_old[StakingPeriod.ONE_YEAR] = 18000; // 365 days
    }

    // ---------- STAKES ----------

    function createStake(uint256 _stake, StakingPeriod _stakePeriod) public {
        require(_stake > 0, "stake value should not be zero");
        require(myToken.transferFrom(msg.sender, address(this), _stake), "Token Transfer Failed");
        if(stakes[msg.sender][_stakePeriod].amount == 0) {
            addStakeholder(msg.sender);
            stakes[msg.sender][_stakePeriod] = stake(_stake, _stakePeriod, block.timestamp);
            totalStake = totalStake.add(_stake);
        } else {
            stake memory tempStake = stakes[msg.sender][_stakePeriod];
            tempStake.amount = tempStake.amount.add(_stake);
            tempStake.timestamp = block.timestamp;
            stakes[msg.sender][_stakePeriod] = tempStake;
            totalStake = totalStake.add(_stake);
        }
        emit TokenStaked(msg.sender, _stake, _stakePeriod, block.timestamp);
    }

    function unStake(uint256 _stake, StakingPeriod _stakePeriod) public {
        require(_stake > 0, "stake value should not be zero");
        stake memory tempStake = stakes[msg.sender][_stakePeriod];
        require(validateStakingPeriod(tempStake), "Staking period is not expired");
        require(_stake <= tempStake.amount, "Invalid Stake Amount");
        uint256 _investorReward = getDailyRewards(_stakePeriod);
        tempStake.amount = tempStake.amount.sub(_stake);
        stakes[msg.sender][_stakePeriod] = tempStake;
        totalStake = totalStake.sub(_stake);
        totalRewards = totalRewards.add(_investorReward);
        //uint256 tokensToBeTransfer = _stake.add(_investorReward);
        if(stakes[msg.sender][_stakePeriod].amount == 0) removeStakeholder(msg.sender);
        myToken.transfer(msg.sender, _stake);
        myToken.transferFrom(owner(), msg.sender, _investorReward);
        emit TokenUnstaked(msg.sender, _stake, _stakePeriod, block.timestamp);
        emit RewardsTransferred(msg.sender, _investorReward, _stakePeriod, block.timestamp);
    }

    function createOldInvestorList(address[] memory _address, uint256[] memory _stake, StakingPeriod[] memory _stakePeriod, uint[] memory _timeStamp) public onlyOwner {
        for(uint i = 0 ; i < _address.length ; i++) {
            require(_stake[i] > 0, "stake value should not be zero");
            tokenAmountInOldInvestorList += _stake[i];
            if(stakes[_address[i]][_stakePeriod[i]].amount == 0) {
                addStakeholder(_address[i]);
                stakes[_address[i]][_stakePeriod[i]] = stake(_stake[i], _stakePeriod[i], _timeStamp[i]);
                totalStake = totalStake.add(_stake[i]);
            } else {
                stake memory tempStake = stakes[_address[i]][_stakePeriod[i]];
                tempStake.amount = tempStake.amount.add(_stake[i]);
                tempStake.timestamp = _timeStamp[i];
                stakes[_address[i]][_stakePeriod[i]] = tempStake;
                totalStake = totalStake.add(_stake[i]);
            }
            emit TokenStaked(_address[i], _stake[i], _stakePeriod[i], _timeStamp[i]);
        }
    }
    function addTokenInContract(address _owner) external{
        require(myToken.transferFrom(_owner, address(this), tokenAmountInOldInvestorList), "Token Transfer Failed");
    }

    function getInvestorRewards(uint256 _unstakeAmount, stake memory _investor, uint _timeStamp) internal view returns (uint256) {
        if(_timeStamp <= oldTimeStamp){
            return _unstakeAmount.mul(apr_old[_investor.stakePeriod]).div(100).div(100);
        } else {
            return _unstakeAmount.mul(apr[_investor.stakePeriod]).div(100).div(100);
        }
    } 

    function setOldTimeStamp(uint _timeStamp) public onlyOwner() {
        oldTimeStamp = _timeStamp;
    }

    function validateStakingPeriod(stake memory _investor) internal view returns(bool) {
        uint256 stakingTimeStamp = _investor.timestamp + getStakingPeriodInNumbers(_investor);
        return block.timestamp >= stakingTimeStamp; 
    } 

    function getStakingPeriodInNumbers(stake memory _investor) internal pure returns (uint256){
        return _investor.stakePeriod == StakingPeriod.ONE_MONTH ? 15 days : _investor.stakePeriod == StakingPeriod.TWO_MONTH ? 30 days : _investor.stakePeriod == StakingPeriod.THREE_MONTH ? 90 days : _investor.stakePeriod == StakingPeriod.SIX_MONTH ? 120 days : _investor.stakePeriod == StakingPeriod.ONE_YEAR ? 365 days : 0; 
    }

    function stakeOf(address _stakeholder, StakingPeriod _stakePeriod)
        public
        view
        returns(uint256)
    {
        return stakes[_stakeholder][_stakePeriod].amount;
    }

    function stakingPeriodOf(address _stakeholder, StakingPeriod _stakePeriod) public view returns (StakingPeriod) {
        return stakes[_stakeholder][_stakePeriod].stakePeriod;
    }

    function getDailyRewards(StakingPeriod _stakePeriod) public view returns (uint256) {
        stake memory tempStake = stakes[msg.sender][_stakePeriod];
        uint256 total_rewards = getInvestorRewards(tempStake.amount, tempStake, tempStake.timestamp);
        uint256 noOfDays = (block.timestamp - tempStake.timestamp).div(60).div(60).div(24);
        noOfDays = (noOfDays < 1) ? 1 : noOfDays;
        return total_rewards.div(365).mul(noOfDays);
    }

    function getRewardsPerDay(StakingPeriod _stakePeriod) public view returns (uint256) {
        stake memory tempStake = stakes[msg.sender][_stakePeriod];
        uint256 total_rewards = getInvestorRewards(tempStake.amount, tempStake, tempStake.timestamp);
        return total_rewards.div(365);
    }

    function getExpiredDay(StakingPeriod _stakePeriod) public view returns (uint256) {
        stake memory tempStake = stakes[msg.sender][_stakePeriod];
        uint256 expiredDay = tempStake.timestamp + getStakingPeriodInNumbers(tempStake);
        return expiredDay;
    }

    // ---------- STAKEHOLDERS ----------

    function isStakeholder(address _address)
        internal
        view
        returns(bool, uint256)
    {
        for (uint256 s = 0; s < stakeholders.length; s += 1){
            if (_address == stakeholders[s]) return (true, s);
        }
        return (false, 0);
    }


    function addStakeholder(address _stakeholder)
        internal
    {
        (bool _isStakeholder, ) = isStakeholder(_stakeholder);
        if(!_isStakeholder) stakeholders.push(_stakeholder);
    }


    function removeStakeholder(address _stakeholder)
        internal
    {
        (bool _isStakeholder, uint256 s) = isStakeholder(_stakeholder);
        if(_isStakeholder){
            stakeholders[s] = stakeholders[stakeholders.length - 1];
            stakeholders.pop();
        } 
    }
    // ---------- REWARDS ----------


    function getTotalRewards()
        public
        view
        returns(uint256)
    {
        return totalRewards;
    }

    // ---- Staking APY  setters ---- 

    function setApyPercentage(uint _percentage, StakingPeriod _stakePeriod) public onlyOwner {
        apr[_stakePeriod] = _percentage;
    }

    function setOldApyPercentage(uint _percentage, StakingPeriod _stakePeriod) public onlyOwner {
        apr_old[_stakePeriod] = _percentage;
    }

    function remainingTokens() public view returns (uint256) {
        return Math.min(myToken.balanceOf(owner()), myToken.allowance(owner(), address(this)));
    }

}

